/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `jumlahkunjungan_pasien`(pin_limit INT)
BEGIN
		SELECT a.created_at, a.created_by,b.name AS namapasien, b.image AS fotopasien, b.telephone, b.email, COUNT(*) AS jmlKunjungan
		FROM transaksibookings a, users b
