/* Procedure structure for procedure `mart_booking` */

/*!50003 DROP PROCEDURE IF EXISTS  `mart_booking` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `mart_booking`()
BEGIN
		
	DECLARE done INT DEFAULT FALSE;
	DECLARE JumlahBooking 			INT;
	DECLARE JumlahCancel 			INT;
	DECLARE JumlahKonfirmasiAkanDatang 	INT;
	DECLARE JumlahKonfirmasiWalkin 		INT;  
	declare mingguskr			int;
	
		
	
		
	DECLARE cur1 CURSOR FOR   
			SELECT 
				MAX(IF(aa.stat="Pemesanan",aa.jumlah,"0")) AS JumlahBooking,
				MAX(IF(aa.stat="Batal",aa.jumlah,"0")) AS JumlahCancel,
				MAX(IF(aa.stat="Menunggu konfirmasi klinik",aa.jumlah,"0")) AS JumlahKonfirmasiAkanDatang,
				MAX(IF(aa.stat="Telah dikonfirmasi klinik",aa.jumlah,"0")) AS JumlahKonfirmasiWalkin
			FROM
				(
						SELECT a.xs1 AS stat, IFNULL(bb.jumlah,0) AS jumlah
						FROM params a
						LEFT JOIN
							(
								SELECT b.xs1,`status`,COUNT(*) AS jumlah
								FROM transaksibookings a
								LEFT JOIN params b ON b.xn1=a.`status`
								WHERE 
								      WEEKOFYEAR(a.`created_at`)= WEEKOFYEAR(NOW())
								GROUP BY `status`,b.xs1
							)bb ON bb.status = a.`xn1`
						WHERE
						    a.keterangan ="statusBooking"
				)aa
			;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;			
	
	SELECT MAX(`week`) AS mingguterakhir INTO mingguskr
	FROM mart_booking
	WHERE
		`year` = DATE_FORMAT(NOW(),"%Y")
	;
	
	
	
	OPEN cur1;		
		
		ins_loop: LOOP
				FETCH cur1 INTO
					JumlahBooking,
					JumlahCancel,
					JumlahKonfirmasiAkanDatang,
					JumlahKonfirmasiWalkin
				;
				
				IF done THEN
					LEAVE ins_loop;
				END IF;				
				
				
				
				if mingguskr = WEEKOFYEAR(NOW()) then
				
					update mart_booking a
					set 
						a.jumlahbooking = JumlahBooking,
						a.jumlahcancel = jumlahcancel,
						a.jumlah_konfirmasi_akan_datang_user = JumlahKonfirmasiAkanDatang,
						a.jumlah_konfirmasi_kedatangan_walk_in = JumlahKonfirmasiWalkin,
						a.update_at = NOW()
						
					where
						a.week = WEEKOFYEAR(NOW());
						
				else
				
				
						jumlahbooking,
						jumlahcancel,
						jumlah_konfirmasi_akan_datang_user,
						jumlah_konfirmasi_kedatangan_walk_in,					
						`week`,
						`month`,
						`year`
					) VALUES (
						JumlahBooking,
						JumlahCancel,
						JumlahKonfirmasiAkanDatang,
						JumlahKonfirmasiWalkin,					
						WEEKOFYEAR(NOW()) ,
						DATE_FORMAT(NOW(),"%m"),
						DATE_FORMAT(NOW(),"%Y") 
					);
				end if;
					
					
					
		END LOOP ins_loop;
	CLOSE cur1;	
		
		
		
		
	END */$$
DELIMITER ;

/* Procedure structure for procedure `mart_booking_manual` */

/*!50003 DROP PROCEDURE IF EXISTS  `mart_booking_manual` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `mart_booking_manual`(mingguke int)
BEGIN
		
	DECLARE done INT DEFAULT FALSE;
	DECLARE JumlahBooking 			INT;
	DECLARE JumlahCancel 			INT;
	DECLARE JumlahKonfirmasiAkanDatang 	INT;
	DECLARE JumlahKonfirmasiWalkin 		INT;  
	DECLARE mingguskr			INT;
	DECLARE wk			        INT;
	
		
	
		
	DECLARE cur1 CURSOR FOR   
			SELECT 
				MAX(IF(aa.stat="Pemesanan",aa.jumlah,"0")) AS JumlahBooking,
				MAX(IF(aa.stat="Batal",aa.jumlah,"0")) AS JumlahCancel,
				MAX(IF(aa.stat="Menunggu konfirmasi klinik",aa.jumlah,"0")) AS JumlahKonfirmasiAkanDatang,
				MAX(IF(aa.stat="Telah dikonfirmasi klinik",aa.jumlah,"0")) AS JumlahKonfirmasiWalkin
			FROM
				(
						SELECT a.xs1 AS stat, IFNULL(bb.jumlah,0) AS jumlah
						FROM params a
						LEFT JOIN
							(
								SELECT b.xs1,`status`,COUNT(*) AS jumlah
								FROM transaksibookings a
								LEFT JOIN params b ON b.xn1=a.`status`
								WHERE 
								      WEEKOFYEAR(a.`created_at`)= mingguke
								GROUP BY `status`,b.xs1
							)bb ON bb.status = a.`xn1`
						WHERE
						    a.keterangan ="statusBooking"
				)aa
			;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;			
	
	SELECT MAX(`week`) AS mingguterakhir INTO mingguskr
	FROM mart_booking
	WHERE
		`year` = DATE_FORMAT(NOW(),"%Y")
	;
	
	SELECT count(`week`) AS wk INTO wk
	FROM mart_booking
	WHERE
		`year` = DATE_FORMAT(NOW(),"%Y")
		and week = mingguke
	;
	
	
	
	OPEN cur1;		
		
		ins_loop: LOOP
				FETCH cur1 INTO
					JumlahBooking,
					JumlahCancel,
					JumlahKonfirmasiAkanDatang,
					JumlahKonfirmasiWalkin
				;
				
				IF done THEN
					LEAVE ins_loop;
				END IF;				
				
				
				
				IF mingguskr = mingguke OR wk > 0 THEN
				
					UPDATE mart_booking a
					SET 
						a.jumlahbooking = JumlahBooking,
						a.jumlahcancel = jumlahcancel,
						a.jumlah_konfirmasi_akan_datang_user = JumlahKonfirmasiAkanDatang,
						a.jumlah_konfirmasi_kedatangan_walk_in = JumlahKonfirmasiWalkin,
						a.update_at = NOW()
						
					WHERE
						a.week = mingguke;						
				
				ELSE
				
				
						jumlahbooking,
						jumlahcancel,
						jumlah_konfirmasi_akan_datang_user,
						jumlah_konfirmasi_kedatangan_walk_in,					
						`week`,
						`month`,
						`year`
					) VALUES (
						JumlahBooking,
						JumlahCancel,
						JumlahKonfirmasiAkanDatang,
						JumlahKonfirmasiWalkin,					
						mingguke ,
						DATE_FORMAT(NOW(),"%m"),
						DATE_FORMAT(NOW(),"%Y") 
					);
				END IF;
					
					
					
		END LOOP ins_loop;
	CLOSE cur1;	
		
		
		
		
	END */$$
DELIMITER ;

