/* Procedure structure for procedure `mart_poliklinik` */

/*!50003 DROP PROCEDURE IF EXISTS  `mart_poliklinik` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `mart_poliklinik`()
BEGIN
	
		DECLARE done INT DEFAULT FALSE;
		DECLARE idpoli		INT;
		DECLARE idtrx		INT;
		DECLARE jmlBook		INT;
		DECLARE id_dokter	INT;
		DECLARE jam_Praktek	TIME;
		DECLARE mingguskr	INT;
	
	
		DECLARE cur1 CURSOR FOR   
				SELECT a.`idpoliklinik`,COUNT(*) AS jumlahBooking,a.`iddokter`, TIME_FORMAT(a.`jampraktek_awal`,"%H:%i") AS jamPraktek
				FROM transaksibookings a
				WHERE
					WEEKOFYEAR(a.`created_at`)=WEEKOFYEAR(NOW())
				GROUP BY a.idpoliklinik, a.`iddokter`,a.`jampraktek_awal`
			;
		DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;	
		
		
		
		SELECT MAX(`week`) AS mingguterakhir INTO mingguskr
		FROM mart_poliklinik
		WHERE
			`year` = DATE_FORMAT(NOW(),"%Y")
		;
		
		IF mingguskr = WEEKOFYEAR(NOW()) THEN
			
			DELETE FROM `mart_poliklinik`
			WHERE 
			WEEK = WEEKOFYEAR(NOW());
			
		end if;
			
		OPEN cur1;
	
			ins_loop: LOOP
					FETCH cur1 INTO
						idpoli,
						jmlBook,
						id_dokter,
						jam_Praktek
					;
					
					IF done THEN
						LEAVE ins_loop;
					END IF;	
					
					
					
							idpoliklinik,
							jumlahBooking,
							iddokter,
							jampraktek,										
							`week`,
							`month`,
							`year`,
							update_at
						) VALUES (
							idpoli,	
							jmlBook,
							id_dokter,
							jam_Praktek,							
							WEEKOFYEAR(NOW()) ,
							DATE_FORMAT(NOW(),"%m"),
							DATE_FORMAT(NOW(),"%Y"),
							NOW()
						);
					
						
						
			END LOOP ins_loop;
		CLOSE cur1;	
	
	
	END */$$
DELIMITER ;

/* Procedure structure for procedure `mart_poliklinik_manual` */

/*!50003 DROP PROCEDURE IF EXISTS  `mart_poliklinik_manual` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `mart_poliklinik_manual`(mingguke int)
BEGIN
	
		DECLARE done INT DEFAULT FALSE;
		DECLARE idpoli		INT;
		DECLARE idtrx		INT;
		DECLARE jmlBook		INT;
		DECLARE id_dokter	INT;
		DECLARE jam_Praktek	TIME;
		DECLARE mingguskr	INT;
	
	
		DECLARE cur1 CURSOR FOR   
				SELECT a.`idpoliklinik`,COUNT(*) AS jumlahBooking,a.`iddokter`, TIME_FORMAT(a.`jampraktek_awal`,"%H:%i") AS jamPraktek
				FROM transaksibookings a
				WHERE
					WEEKOFYEAR(a.`created_at`)= mingguke
				GROUP BY a.idpoliklinik, a.`iddokter`,a.`jampraktek_awal`
			;
		DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;	
		
		
		
		SELECT MAX(`week`) AS mingguterakhir INTO mingguskr
		FROM mart_poliklinik
		WHERE
			`year` = DATE_FORMAT(NOW(),"%Y")
		;
		
		IF mingguskr = mingguke THEN
			
			DELETE FROM `mart_poliklinik`
			WHERE 
			WEEK = WEEKOFYEAR(NOW());
			
		end if;
			
		OPEN cur1;
	
			ins_loop: LOOP
					FETCH cur1 INTO
						idpoli,
						jmlBook,
						id_dokter,
						jam_Praktek
					;
					
					IF done THEN
						LEAVE ins_loop;
					END IF;	
					
					
					
							idpoliklinik,
							jumlahBooking,
							iddokter,
							jampraktek,										
							`week`,
							`month`,
							`year`,
							update_at
						) VALUES (
							idpoli,	
							jmlBook,
							id_dokter,
							jam_Praktek,							
							mingguke ,
							DATE_FORMAT(NOW(),"%m"),
							DATE_FORMAT(NOW(),"%Y"),
							NOW()
						);
					
						
						
			END LOOP ins_loop;
		CLOSE cur1;	
	
	
	END */$$
DELIMITER ;

/* Procedure structure for procedure `report_JumlahBookingPeriode` */

/*!50003 DROP PROCEDURE IF EXISTS  `report_JumlahBookingPeriode` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `report_JumlahBookingPeriode`(tglAwal DATE,tglAkhir DATE)
BEGIN
	SELECT 
	MAX(IF(aa.stat="Pemesanan",aa.jumlah,"0")) AS JumlahBooking,
	MAX(IF(aa.stat="Batal",aa.jumlah,"0")) AS JumlahCancel,
	MAX(IF(aa.stat="Menunggu konfirmasi klinik",aa.jumlah,"0")) AS JumlahKonfirmasiAkanDatang,
	MAX(IF(aa.stat="Telah dikonfirmasi klinik",aa.jumlah,"0")) AS JumlahKonfirmasiWalkin,
	MAX(IF(aa.stat="Pemesanan",aa.jumlah,"0")) + MAX(IF(aa.stat="Batal",aa.jumlah,"0")) +
	MAX(IF(aa.stat="Menunggu konfirmasi klinik",aa.jumlah,"0"))+
	MAX(IF(aa.stat="Telah dikonfirmasi klinik",aa.jumlah,"0"))
	 AS total
FROM
	(
			SELECT a.xs1 AS stat, IFNULL(bb.jumlah,0) AS jumlah
			FROM params a
			LEFT JOIN
				(
					SELECT b.xs1,`status`,COUNT(*) AS jumlah
					FROM transaksibookings a
					LEFT JOIN params b ON b.xn1=a.`status`
					WHERE 					      
					      a.`created_at` BETWEEN DATE(tglAwal) AND DATE(tglAkhir)
					GROUP BY `status`,b.xs1
				)bb ON bb.status = a.`xn1`
			WHERE
			    a.keterangan ="statusBooking"
	)aa;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `report_JumlahTrxAll` */

/*!50003 DROP PROCEDURE IF EXISTS  `report_JumlahTrxAll` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `report_JumlahTrxAll`(tglAwal DATE,tglAkhir DATE)
BEGIN
	
		SELECT a.kodebooking,
			c.`namapoliklinik`,
			tanggalbooking,
			jampraktek_awal AS jampraktek,
			a.created_at AS tanggalTransaksi
		FROM transaksibookings a
		LEFT JOIN params b ON b.xn1=a.`status`
		LEFT JOIN `poliklinik` c ON a.`idpoliklinik`=c.`id`
		WHERE 
		       a.`created_at` BETWEEN DATE(tglAwal) AND DATE(tglAkhir)
		       AND b.keterangan ="statusBooking"
		     ORDER BY a.created_at;
END */$$
DELIMITER ;

/* Procedure structure for procedure `update_antrian` */

