DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `update_antrian`(
  IN `pin_kodebooking` INT (10),
  IN `pin_idkeluarga` INT (10),
  IN `pin_tanggalpraktek` VARCHAR (191),
