/* Procedure structure for procedure `update_counter_booking` */

/*!50003 DROP PROCEDURE IF EXISTS  `update_counter_booking` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `update_counter_booking`(
  IN `pin_tanggalpraktek` VARCHAR (191),
  IN `pin_hari` VARCHAR (10),
  IN `pin_jampraktek_awal` VARCHAR (10),
  IN `pin_jampraktek_akhir` VARCHAR (10),
  IN `pin_dokter` INT (10),
  IN `pin_idpoliklinik` INT (10),
  IN `pin_status` INT (10)
)
BEGIN
  DECLARE vidpraktek INT;
  DECLARE cbidpraktek INT;
  DECLARE kuotapasien INT;
  DECLARE currentsequence INT;
  DECLARE newsequence INT;
  DECLARE jadwalpraktek VARCHAR(191);
  
  SELECT
    ap.id,
    ap.kuotapasien INTO vidpraktek,
    kuotapasien
  FROM
    jadwalpraktek AS ap
  WHERE ap.status = 1
    AND ap.jampraktek_awal = pin_jampraktek_awal
    AND ap.jampraktek_akhir = pin_jampraktek_akhir
    AND ap.dokter = pin_dokter
    AND ap.idpoliklinik = pin_idpoliklinik
    AND ap.hari = pin_hari;
    
  IF vidpraktek != '' THEN
  
	IF pin_status = -1 OR pin_status = 1 OR pin_status = 99 THEN
		SELECT cb.idpraktek, cb.tanggalpraktek, cb.sequence INTO cbidpraktek, jadwalpraktek, currentsequence
		FROM counterbooking AS cb
		WHERE cb.idpraktek = vidpraktek
		AND cb.tanggalpraktek = pin_tanggalpraktek;
		
		IF currentsequence = '' OR currentsequence IS NULL THEN
			SET newsequence = 1;
		ELSEIF pin_status = 99  OR currentsequence = kuotapasien THEN
			SET newsequence = kuotapasien;
		ELSEIF pin_status = -1 THEN
			SET newsequence = currentsequence - 1;
		ELSE
			SET newsequence = currentsequence + 1;
		END IF;
		  
		IF cbidpraktek = vidpraktek AND jadwalpraktek = pin_tanggalpraktek THEN
			UPDATE counterbooking
			SET
				updated_at = NOW(),
				sequence = newsequence
			WHERE 
				idpraktek = vidpraktek
			AND
				tanggalpraktek = pin_tanggalpraktek
			;
		ELSE
				created_at,
				updated_at,
				idpraktek,
				kuota,
				sequence,
				tanggalpraktek
			) VALUES (
				NOW(),
				NOW(),
				vidpraktek,
				kuotapasien,
				newsequence,
				pin_tanggalpraktek
			);	   
		END IF;
    
	END IF;
    
  END IF;
END */$$
DELIMITER ;

