(1,'N1001','Tips Ibu Menyusui','Tips menyusui yang paling utama agar Anda dan si buah hati merasa nyaman adalah memperhatikan posisi menyusui. Dilansir dari Livescience, menurut Debbie Pierce, seorang konsultan menyusui di Kaiser Permanente Colorado, para ibu dianjurkan untuk mencoba berbagai posisi menyusui untuk mencegah berbagai masalah yang dapat terjadi pada payudara saat menyusui berlangsung.','ibu-menyusui.jpg','https://play.google.com/store/apps/details?id=com.swamedia.klinikmutiara.booking',0,NULL,NULL,'2019-07-02 08:50:46'),
(2,NULL,'Welcome','Promo di akhir bulan Februari 2018. Bunda, lindungi kesehatan buah hati tercinta dari berbagai macam penyakit menular dan berat.','gambar20191211023103.png','https://mutiaracikutra.com',1,NULL,NULL,'2019-12-11 02:31:03'),
(3,'N002','Rawat dan jaga kesehatan anak anda','Rawat dan jaga kesehatan anak anda','gambar20191211023211.png','https://mutiaracikutra.com',1,NULL,'2019-12-11 02:32:11','2019-12-11 02:32:11'),
